import React, { useState, useEffect } from 'react'
import { Container } from '../styled/layoutStyle'
import firebase from '../config'
import Table from 'react-bootstrap/Table'

function History() {
  const [History, setHistory] = useState([]);
  const [Loading, setLoading] = useState(false);
  const firebaseRef = firebase.firestore().collection("History");

  useEffect(() => {
    function getHistory() {
      setLoading(true);
      firebaseRef.get().then((item) => {
        const items = item.docs.map((doc) => doc.data());
        setHistory(items);
        setLoading(false);
      });
    }
    getHistory();
  }, []);
  console.log(History);


  const renderHistory = () => {
    return (
      <Container >
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Start</th>
              <th>End</th>
              <th></th>
              <th>Username</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <td>2</td>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <td>3</td>
              <td colSpan={2}>Larry the Bird</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </Table>
        {/* <Table striped bordered hover size="lg">
          <tr>
            <thead>
              <th scope="col">Start</th>
              <th scope="col">End</th>
              <th scope="col">Prime count</th>
              <th scope="col">Prime number</th>
              <th>timestamp</th>
            </thead>
            <tbody >
              {History.map((item, i) => (
                <tr key={i}>
                  <td>{item.start}</td>
                  <td>{item.end}</td>
                  <td>{item.cntprime}</td>
                  <td>{item.prime}</td>
                  <td>{`${item.timestamp}`}</td>
                </tr>
              ))}
            </tbody>
          </tr>
        </Table> */}



      </Container>
    );
  };

  return (

    <Container>
      <h1>History</h1>
      <div>{renderHistory()}</div>
    </Container>
  )
}

export default History
